    return (
      <div className="m-2 w-1/6 p-4 bg-gradient-to-r from-indigo-700 to-sky-700 rounded-lg shadow-lg flex items-center justify-center">
        <p className="text-white text-center">{ip}</p>
        <p className="text-white text-center">{macAddress}</p>
      </div>
    );
  };

  export default IpMacPairCard;
